/*
    Is used to generate a new report for the user
    Will need to use the input to send to the backend, possibly redirect to another component
    @Notes: Lyka Marcelino, 04/09/2020
 */

import React from 'react';
import {Form, Button, Dropdown, InputGroup} from 'react-bootstrap';

const newblock = {
    backgroundColor: "whitesmoke",
    borderRadius: "50px",
    display: "block",
    width: "1200px",
    height: "600px",
    textAlign: "center",
    marginLeft: "220px",
    marginTop: "40px",
    alignContent: "center",
}

export default class NewReport extends React.Component {
    state = {
        fileName: '',
        predictionType: '',
        frequency: '',
        numPredictions: ''
    }

    render() {
        return(
            <form>
                <input placeholder = 'New File Name' value = {this.state.fileName}/>

            </form>
        )
    }
}
